import React from 'react';

import './Steps.css';

const Steps = () => (
    <div className="Steps">
        <Step image={timeIcon}/>
        <Step image={audioIcon}/>
        <Step image={heartIcon}/>
        <Step image={lockIcon}/>
    </div>
);

export default Steps;
